import React,{ useEffect } from "react";
// import { Link } from "react-router-dom";

function Form() {
    useEffect(() => {
        document.title = 'Form';
    });
    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <form>
                <input type="text"/>
                <input type="file"/>
                <input type="button" value=""/>
            </form>
        </>
    )
}

export default Form
